!                                                                      !
!     modify history:                                                  !
!       jan. 14, 2004   --  yu-tai hou    convert subroutine to data   !
!                           module for ncep models.                    !
!                                                                      !
! *********         the original program descriptions        ********* !
!                                                                      !
!     adapted from j. delamere,  atmospheric & environmental research. !
